function Choix() {
    

  let history = useHistory();
    return (
        <div className="choix">
        
        
     <div> Veuillez choisir un style de cartes </div> 
        
     

<div className="calquesdeschoix" onClick={() => {
                history.push(`/form`);
              }}>
      <img src={model} /> 
      
      <p>Les animaux</p>
       </div>



       <div className="ligne" onClick={() => {
                history.push(`/form2`);
              }}>
      <img src={model2} /> 
      
      <p>Illustrations</p>
       </div>

